INSERT INTO `history` VALUES (15,'adminuser@email.com','2023-09-19','2023-09-19','Programming in C#','Jesse Liberty','The first part of the book contains a short guide through the basics of the C# â€“ language syntax, it presents reserved words and concepts that make C# and .NET effective environments for making Windows and Web applications. Among other things, the first part describes:\n\n- Classes and facilities\n- Inheritance and polymorphism\n- Operator switching\n- Generic templates, collections and iterators\n- Structures and interfaces\n- Work with sign strings and regular expressions\n- Processing of exceptions and errors\n- Delegates and events\n\nIn the second part, readers will learn to use C# in three key development environments - ASP.NET, .NET Windows Forms and ADO.NET - so they can make programs for Windows and Web, including applications that use the selected Web reader environment and standard Web services.',_binary 'data:image/png;base64, '),(71,'testuser@email.com','2023-10-01','2023-10-09','Web Development with MongoDB and NodeJS','Mithun Satheesh, Bruno Joseph ','Node.js and MongoDB are quickly becoming one of the most popular tech stacks for the web. Powered by Google\'s V8 engine, Node.js caters to easily building fast, scalable network applications while MongoDB is the perfect fit as a scalable, high-performance, open source NoSQL database solution. Using these two technologies together, web applications can be built quickly and easily and deployed to the cloud with very little difficulty.\n\nThe book will begin by introducing you to the groundwork needed to set up the development environment. Here, you will quickly run through the steps necessary to get the main application server up and running. Then you will see how to use Node.js to connect to a MongoDB database and perform data manipulations.',_binary 'data:image/png;base64,  ');
